    public void TestrGenBuiltindimnames_testdimnames16_4066274e36828142845cd4a81fcd34a2() {
        assertEval("argv <- list(structure(c('4.1-0', '4.1-0', '4.1-0', '4.1-0', '4.1-0', '4.1-0', '4.0-3', '4.0-3', '4.0-3', '4.0-3', '4.0-3', '4.0-2', '4.0-2', '4.0-1', '4.0-1', '4.0-1', '4.0-1', '4.0-1', '4.0-1', '4.0-1', '4.0-1', '3.1-55', '3.1-55', '3.1-55', '3.1-54', '3.1-53', '3.1-53', '3.1-52', '3.1-51', NA, NA, NA, NA, NA, NA, NA, NA, NA, NA, NA, NA, NA, NA, NA, NA, NA, NA, NA, NA, NA, NA, NA, NA, NA, NA, NA, NA, NA, NA, NA, NA, NA, NA, NA, NA, NA, NA, NA, NA, NA, NA, NA, NA, NA, NA, NA, NA, NA, NA, NA, NA, NA, NA, NA, NA, NA, NA, 'The C and R code has been reformatted for legibility.', 'The old compatibility function rpconvert() has been removed.', 'The cross-validation functions allow for user interrupt at the end\nof evaluating each split.', 'Variable Reliability in data set car90 is corrected to be an\nordered factor, as documented.', 'Surrogate splits are now considered only if they send two or more\ncases _with non-zero weight_ each way.  For numeric/ordinal\nvariables the restriction to non-zero weights is new: for\ncategorical variables this is a new restriction.', 'Surrogate splits which improve only by rounding error over the\ndefault split are no longer returned.  Where weights and missing\nvalues are present, the splits component for some of these was not\nreturned correctly.', 'A fit of class \'rpart\' now contains a component for variable\nimportance, which is reported by the summary() method.', 'The text() method gains a minlength argument, like the labels()\nmethod.  This adds finer control: the default remains pretty =\nNULL, minlength = 1L.', 'The handling of fits with zero and fractional weights has been\ncorrected: the results may be slightly different (or even\nsubstantially different when the proportion of zero weights is\nlarge).', 'Some memory leaks have been plugged.', 'There is a second vignette, longintro.Rnw, a version of the\noriginal Mayo Tecnical Report on rpart.', 'Added dataset car90, a corrected version of the S-PLUS dataset\ncar.all (used with permission).', 'This version does not use paste0{} and so works with R 2.14.x.', 'Merged in a set of Splus code changes that had accumulated at Mayo\nover the course of a decade. The primary one is a change in how\nindexing is done in the underlying C code, which leads to a major\nspeed increase for large data sets.  Essentially, for the lower\nleaves all our time used to be eaten up by bookkeeping, and this\nwas replaced by a different approach.  The primary routine also\nuses .Call{} so as to be more memory efficient.', 'The other major change was an error for asymmetric loss matrices,\nprompted by a user query.  With L=loss asymmetric, the altered\npriors were computed incorrectly - they were using L' instead of L.\nUpshot - the tree would not not necessarily choose optimal splits\nfor the given loss matrix.  Once chosen, splits were evaluated\ncorrectly.  The printed improvement values are of course the\nwrong ones as well.  It is interesting that for my little test\ncase, with L quite asymmetric, the early splits in the tree are\nunchanged - a good split still looks good.', 'Add the return.all argument to xpred.rpart().', 'Added a set of formal tests, i.e., cases with known answers to\nwhich we can compare.', 'Add a usercode vignette, explaining how to add user defined\nsplitting functions.', 'The class method now also returns the node probability.', 'Add the stagec data set, used in some tests.', 'The plot.rpart routine needs to store a value that will be visible\nto the rpartco routine at a later time.  This is now done in an\nenvironment in the namespace.', 'Force use of registered symbols in R >= 2.16.0', 'Update Polish translations.', 'Work on message formats.', 'Add Polish translations', 'rpart, rpart.matrix: allow backticks in formulae.', 'tests/backtick.R: regession test', 'src/xval.c: ensure unused code is not compiled in.', 'Change description of margin in ?plot.rpart as suggested by Bill\nVenables.'), .Dim = c(29L, 4L)));dimnames(argv[[1]]);");
    }

